import React from 'react';
import logo from './logo.svg';
import { Header } from './components/Header/Header';
import { PetsCard } from './components/PetsCards/PetsCards';
import catIcon from "./images/cat20-128.webp";
import dogIcon from "../images/Animal_Dog-256.webp";

import './App.css';

function App() {
  return (
    <div className="App">
     <Header>Choose a survey to get started</Header>
      <div className="flex flex-row flex-wrap justify-center mt-16">
        <PetsCard imgAlt="Cat" imgSrc={catIcon}/>
        <PetsCard imgAlt="Dog" imgSrc={dogIcon}/>
      </div>
    </div>
  );
}

export default App;
